// client/src/components/ViewAirports.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function ViewAirports() {
  const [airports, setAirports] = useState([]);
  const [error, setError] = useState('');

  const fetchAirports = () => {
    axios.get('/api/airports')
      .then(res => {
        setAirports(res.data);
        setError('');
      })
      .catch(err => {
        setError(err.response?.data?.error || 'Failed to load airports');
      });
  };

  useEffect(() => {
    fetchAirports();
  }, []);

  return (
    <div style={{ padding: '2rem' }}>
      <h2>All Airports</h2>
      <button onClick={fetchAirports} style={{ margin: '1rem 0' }}>
        ðŸ”„ Refresh
      </button>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>Airport ID</th>
            <th>Name</th>
            <th>City</th>
            <th>State</th>
            <th>Country</th>
            <th>International</th>
            <th>Location ID</th>
          </tr>
        </thead>
        <tbody>
          {airports.map((a, i) => (
            <tr key={i}>
              <td>{a.airport_id}</td>
              <td>{a.airport_name}</td>
              <td>{a.city}</td>
              <td>{a.state}</td>
              <td>{a.country}</td>
              <td>{String(a.international)}</td>
              <td>{a.location_id}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
